import styled from "styled-components";
export const CarouseWrapper = styled.div`
      width: 100%;
      height: 600px;
      position: relative;
      background-color: #E86E1C;
      

`;
export const PrevButton = styled.a`
      top: 50%;
      left:16px;
      position: absolute;
      color:white;
      font-size:24px;
      font-weight: bold;
      transition: 0.6s ease;
`; 
export const NextButton = styled.a`
      top: 50%;
      right:16px;
      position: absolute;
      color:white;
      font-size:24px;
      font-weight: bold;
      transition: 0.6s ease;
`;
export const Header = styled.div`
      transform: translate(-50%, -50%);
      
     
      position: absolute;
      font-weight:900;
      font-size: 44px;
      font-style: oblique;
      

`
